import React from 'react'
import ReactDOM from 'react-dom'
import Card from './Card'
import sdata from './Sdata'

sdata.map((val) => {
  console.log(val.title)
})
ReactDOM.render(
  <>
    <h1>Hello This is Shyam</h1>
    <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link}
    />
  </>,
  document.getElementById('root')
)
